import './App.css';

import axios from "axios";

function App() {
  return (
    <div className="App">
      <br />
      <h3>Cadastro de Doação</h3>
      <header>
        <button className='btn btn-success'>Adicionar novo cadastro</button>
      </header>
      <table>
        <thead>
          <tr>
            <th></th>
          </tr>
        </thead>
      </table>
    </div>
  );
}

export default App;
